import React, { Component } from 'react'
import Card from './CardUI'

class Cards extends Component {
    render() {
        return (
            <div classname="container-fluid d-fliex justify-content-center">
                <div classNmae="row">
                    <div className="col-md-4">
                        <Card />
                    </div>
                    <div className="col-md-4">
                        <Card />
                    </div>
                    <div className="col-md-4">
                        <Card />
                    </div>
                </div>
            </div>
        )
    }
}
export default Cards;
